import React from 'react'
import { Button } from 'semantic-ui-react'

class Count extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            count: 0
        }
    }

    render(){
        return (
            <div>
                <Button onClick={() => this.props.playSound(), increment()} />
            </div>
        )
    }
}

export default Count;
